import React from "react";
import "./VideoBlog.css";

const VideoBlog = () => {
  return (
    <div className="mainBlog">
      <div className="titleVideoBlog">Видеоблог</div>
      <div className="textVideBlog">Снимаем для вас интересные ролики, в которых делимся полезной информацией</div>
      <div className="videBlog"></div>
      <div>
        <button>Больше полезных видео</button>
      </div>
    </div>
  );
};
export default VideoBlog;
